ads.description:
Witam. Posiadam do sprzedania Seata Toledo III 1.9 TDI BKC 105 KM rok produkcji 2005. Auto w moim posiadaniu od 6 lat. W okresie posiadania wszystkie naprawy wykonywane na bieżąco. Z poważniejszych napraw regeneracja turbiny, wtrysków, wymienione sprzęgło, zaciski tył z tarczami oraz wiele innych. Auto posiada opony wielosezonowe zakupione latem. Świeżo po serwisie filtrów oraz oleju. W lato dobita i odgrzybiona klimatyzacja. PT 01.2026, OC 04.2025. Technicznie wsiadać i użytkować.



Wyposażenie to:



* Klimatyzacja;



* 4 poduszki powietrzne;



* Elektryczne szyby;



* Wspomaganie kierownicy;



* Centralny zamek;



* Czujniki parkowania tył;



* ABS;



* TCS;



* Radio multimedialne;



* Regulacja kierownicy dwu płaszczyznach;



* Regulacja fotela kierowcy w trzech płaszczyznach;



* ISOFIX.



Dla zainteresowanych więcej informacji udzielę telefonicznie.

Sprzedam Hondę CR-V rok produkcji 1999. Silnik 2.0 Benzyna + Gaz 147 KM. Przebieg 344 963, Klimatyzacja.



Auto posiadam 11 lat. Serwis Wykonywany na bieżąco, olejowy i filtry z  interwalem 10 tysięcy km.

Posiadam zapiski z bieżących napraw. Napęd 4x4 dołączany elektronicznie. 

Nadwozie posiada kilka rys- rysek, wgniotek. 



Kilka informacji:

- Przegląd Techniczny do 15.04.2026

- Ubezpieczenie do Maj 2026- opłacona 1 rata. Niska cena ubezpieczenia OC. Na rok to 550 zł. 

- Ostatnia wymiana oleju i filtrów przy przebiegu 341 tyś km;

- Ostatnia wymiana filtrów gazowowych przy 343 tyś km, interwał co 10 tyś km;

- Wymiana akumulatora w roku 2024;

- Opony wielosezonowe Kleber Citilander na felgach aluminiowych;

- Zamontowane jest radio CB firmy TTI - TCB 771

- Butla LPG wymieniona w roku 2024, legalizacja do 2034; zamontowana jest w miejscu koła zapasowego.

- Auto posiada pojemny bagażnik. Wewnatrz auta jest dużo przestrzeni, komfortowo może podróżować 5 osób. Fotele 2 rzędu są składane na płasko. 



Wyposażenie:

- Klimatyzacja;

- Elektryczne szyby x4;

- ABS;

- Centralny zamek z pilotem + kluczyk zapasowy;

- Radio Bluetooth+ mikrofon do rozmów;

- W bagażniku na wyposażeniu jest stolik - Honda;

- Hak;

- Tylnia kanapa dzielona;

- Lusterka boczne ustawiane elektrycznie, podgrzewane;

- Poduszki powietrzne kierowca + pasażer;

- Relingi. 



Posiadam więcej zdjęć. 



Na pytania chętnie odpowiem telefonicznie, lub osobiście. 

Auto można obejrzeć w Legionowie zapraszam do oględzin.
